import React, {useState} from 'react';
import '../assets/css/navbar.css';


const NavBar = (props) => {
    const [isNavCollapsed, setIsNavCollapsed] = useState(true);
    const handleNavCollapse = () => setIsNavCollapsed(!isNavCollapsed);
    let [isActive, setNavActive] = useState(false);
    const handleNavClicked = () => {
        setNavActive(isActive = true);  
    };
    return (
        <nav className='navbar navbar-expand-lg navbar-light' id='navigation-menu'>
            <a className="navbar-brand" href="#" id="logo">
                <img src={require("../assets/images/logo2.png")} alt="logo" />
                Joseph Bautista

            </a>

            <button className="navbar-toggler collapsed" id="navbar-button" type="button" data-toggle="collapse" data-target="#navbarNav" onClick={handleNavCollapse}>
                <span className="navbar-toggler-icon"></span>
            </button>

            <div className={`${isNavCollapsed ? 'collapse' : ''} navbar-collapse`} id="navbarNav">
                <div className="nav navbar-nav ms-auto">
                    <a className={`${isActive ? 'active' : ''} nav-item nav-link`} href="#" onClick={handleNavClicked}>Home</a>
                    <a className={`${isActive ? 'active' : ''} nav-item nav-link`} href="#" onClick={handleNavClicked}>Profile</a>
                    <a className={`${isActive ? 'active' : ''} nav-item nav-link`} href="#"  onClick={handleNavClicked}>Projects</a>
                </div>
            </div>
        </nav>
    );
};

export default NavBar;
